import React from 'react';
import TaskItem from './Taskitem';

const TaskList = ({ tasks, onUpdate, onDelete }) => {
  return (
    <ul className="list-group">
      {tasks.map((task) => (
        <TaskItem
          key={task.id}
          task={task}
          onUpdate={onUpdate}
          onDelete={onDelete}
        />
      ))}
    </ul>
  );
};

export default TaskList;
